import React from "react";
import { useState } from 'react'
import TextField from '@mui/material/TextField';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import ButtonUnstyled from '@mui/base/ButtonUnstyled';
import { Box } from "@mui/system";
import { Stack } from "@mui/material";

function AdminPortal() {

  const [url, setURL] = useState("");

  const handleOnSubmit = async (e) => {
    e.preventDefault();
    let result = await fetch(
    'http://localhost:5000/register', {
        method: "post",
        body: JSON.stringify({ url}),
        headers: {
            'Content-Type': 'application/json'
        }
    })
    result = await result.json();
    console.warn(result);
    if (result) {
        alert("Data saved successfully");
        setURL("");
    }
  }


  return (
    <div className="adminportal">
        <header>
          <h1>Admin Portal</h1>
          <p>Primary Administrator</p>
          <p>University: State University of New York at Albany</p>
        </header>
        <h2>Master Class Link</h2>
        <div>
          <Stack direction="row" spacing={2}>
            <TextField
              disabled
              id="outlined-disabled"
              label="Should retrieve link from backend"
            />
            <Fab size="medium" color="#cfe8fc" aria-label="add" > <AddIcon /> </Fab>
          </Stack>

      </div>
      <h2>Semester Schedule Link</h2>
        <div>
        <Stack direction="row" spacing={2}>
          <TextField
              disabled
              id="outlined-disabled"
              label="Should retrieve link from backend"
          />
          <button type="submit" onClick={handleOnSubmit} color="none"><Fab size="medium" color="#cfe8fc" aria-label="add" > <AddIcon /> </Fab></button>
        </Stack>
      </div>
    </div>
  );
}

export default AdminPortal;
